import React, {createContext, useEffect, useState} from "react";
import UserList from "./list/UserList";
import "../css/main.css"
import Chat from "./chat/Chat";
import {UserContext} from "../../App";

const Main = (props) => {
    return (
        <div className="main">
            <UserContext.Consumer>
                <UserList/>
                <Chat/>
            </UserContext.Consumer>
        </div>
    )
}
export default Main;
